import React, { Component } from 'react';

const ServiceBtn = ({ position, top, left, bgcolor, width, height }) => (
  <button
    style={{
      position: position,
      top: top,
      left: left,
      backgroundColor: bgcolor,
      width: width,
      height: height
    }}
  >
    Services
  </button>
);

const PrixBtn = ({ position, top, left, bgcolor, width, height }) => (
  <button
    style={{
      position: position,
      top: top,
      left: left,
      backgroundColor: bgcolor,
      width: width,
      height: height
    }}
  >
    Prix
  </button>
);

const PromotionBtn = ({ position, top, left, bgcolor, width, height }) => (
  <button
    style={{
      position: position,
      top: top,
      left: left,
      backgroundColor: bgcolor,
      width: width,
      height: height
    }}
  >
    Promotions
  </button>
);

const ImageTarifs = ({ position, width, height, top, left }) => (
  <img
    style={{
      position: position,
      width: width,
      height: height,
      top: top,
      left: left
    }}
    src={require('../../img/tarifs.png')}
    alt='Homeimg'
  />
);

const Service = ({ position }) => (
  <div>
    <h1
      style={{
        position: position
      }}
    >
      Services we offer
    </h1>

    <p
      style={{
        position: position
      }}
    >
      Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod
      tempor incididunt ut labore et dolore magna aliqua. Quam adipiscing vitae
      proin sagittis nisl. Pretium lectus quam id leo in vitae. Amet mattis
      vulputate enim nulla aliquet porttitor lacus luctus. Velit ut tortor
      pretium viverra suspendisse. Lacus vestibulum sed arcu non odio euismod.
      Velit ut tortor pretium viverra suspendisse. Lacus vestibulum sed arcu non
      odio euismod.
    </p>
  </div>
);

export class Services extends Component {
  render() {
    return (
      <div className='mt-5'>
        <div>
          <ServiceBtn />
          <PrixBtn />
          <PromotionBtn />
        </div>
        <div className='d-flex'>
          <ImageTarifs />
          <div>
            <Service />
          </div>
        </div>
      </div>
    );
  }
}

export default Services;
